/*criação da database em ambiente local*/

create database teste_bi
go

/*criação da tabela na base*/

use teste_bi
GO
create table empresas(
	ID_Empresa int identity primary key ,
	cd_cnpj varchar(14) not null,
	fl_matriz bit not null,
	dt_abertura varchar(10) not null,
	nm_razao_social varchar(200) not null,
	cd_natureza_juridica char(4) not null,
	de_natureza_juridica varchar(100) not null,
	nm_logradouro varchar(100),
	nu_logradouro varchar(10),
	cd_cep varchar(10),
	nm_bairro varchar(100),
	nm_municipio varchar(50),
	sg_uf char(2),
	de_situacao varchar(7) not null check (de_situacao in('ATIVA','BAIXADA')),
	de_classif_natureza_juridica varchar(7) not null check (de_classif_natureza_juridica in('PRIVADO','PUBLICO','MISTA'))

)

